import styled from 'styled-components'

const Header = styled.div`
display: flex;
flex-direction: row;
justify-content: space-between;
align-items: center;
background-color: black;
color: white;
padding: 10px;
font-size: 25px;
font-weight: bold;
box-shadow: 0 3px 6px 0 #555;
`;

const AppName = styled.div`
display: flex;
flex-direction: row;
align-items: center;
`;

const AppLogo = styled.img`
width: 48px;
height: 48px;
margin: 15px;
`;

const SearchBox = styled.div`
display: flex;
flex-direction: row;
padding: 10px 10px;
background-color: white;
border-radius: 6px;
margin-left: 20px;
margin-right: 15px;
width: 50%;
height: 25px;
background-color: pink;
align-items: center;
`;

const SearchIcon = styled.img`
 width: 32px;
 height: 32px;
`;

const SearchInput = styled.input`
color: dark
font-size: 16px;
font-weight: bold;
border: none;
outline: none;
margin-left: 12px;
`;

function App() {
  return (
    <Header>
      <AppName>
        <AppLogo src="/VideocutLOGO.png" />
      React Movie App
      </AppName>
        <SearchBox>
            <SearchIcon src="/icons8-search.png" />
            <SearchInput/>
        </SearchBox>
      </Header>
  );
}

export default App;
